import React from 'react';
import './Header.css';
import { slide as Menu } from 'react-burger-menu';

function Header() {
    return (
        <div className="Header">
            <h1>Profess AI</h1>
            <Menu right>
                <a className="menu-item" href="/">
                    Home
        </a>
                <a className="menu-item" href="/about">
                    About
        </a>
                <a className="menu-item" href="/contact">
                    Contact
        </a>
            </Menu>
        </div>
    );
}

export default Header;
